import React from 'react';
const Header = ({title}) => (  
    <header className='text-center'>
        <h1>
            {title}
        </h1>
        <p>Web application for the creation and management of appointments in a veterinary.<br/>Fill out the form and view the agenda.</p>
    </header>
);

export default Header;
